var cells=$("table.graph-table input.ssInputData");$.each(cells,function(){var c=Number($("#maxValue").text());var d=Number($("#minValue").text());console.log("min: "+d+" max: "+c);var h=Number($(this).val());var i=jetColor(h,d,c);var f=i[0];var e=i[1];var a=i[2];$(this).css("background-color","rgba("+f+","+e+","+a+", .8)");$(this).css("border","1px solid rgba("+f+","+e+","+a+", 1)");if(Number(h)<Number(0.3*(c-d))){$(this).css("color","white");$(this).css("font-weight","300")}else{$(this).css("color","black")}});